        <div className="search">
            <div className="searchInputs">
                <input type="text" placeholder={placeholder} />
            </div>
            <div className="dataResult">
                {data.map((value, key) => {
                    return <a className="dataItem" href={value.link} target="_blank">
                        {" "}
                        <p>{value.title}</p>
                    </a>
                })}
            </div>
        </div>
    )
}

